import React from 'react'
import './Opinion.css'

export default function Opinion() {
  return (
    <div class="opinion">
      <p><span>La verdad este chico me laburo piola</span></p>
      <p><span>No me gusto</span></p>
      <p><span>HOVER ME</span></p>
    </div>
  )
}
